// src/components/editor.tsx
import React, { useState } from 'react';
import EditorCanvas from '../components/editor-canvas';
import Toolbox from '../components/toolbox';

const Editor: React.FC = () => {
  const [elements, setElements] = useState<{ type: string; content: React.ReactNode }[]>([]);

  const handleElementDrop = (type: string) => {
    // Add the dropped element to the editor state
    setElements(prevElements => [...prevElements, { type, content: `New ${type}` }]);
  };

  return (
    <div style={{ display: 'flex' }}>
      <Toolbox elements={[ /* Define elements for the toolbox */ ]} /> {/* Render the Toolbox component */}
      <EditorCanvas elements={elements} onElementDrop={handleElementDrop} /> {/* Render the EditorCanvas component */}
    </div>
  );
};

export default Editor;
